INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(2, 'Custom landing page 1', 'block_landing_page1', '<div class="landing-page nested-container">\r\n	<br />\r\n    \r\n	<div class="vertical-section grid12-4 persistent-grid2-1">\r\n        <a href="{{store direct_url="downloadable/ebooks.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/fortis/custom/landing/vert1.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark2 full-width">\r\n                <h2 class="heading permanent">Lorem</h2>\r\n                <p class="permanent">Nullam ornare enim nectis</p>\r\n                <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n	<div class="vertical-section grid12-4 persistent-grid2-1">\r\n        <a href="{{store direct_url="downloadable/music.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/fortis/custom/landing/vert2.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark2 full-width">\r\n	            <h2 class="heading permanent">Ipsum</h2>\r\n    	        <p class="permanent">In eget metus ornare itis est</p>\r\n        	    <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n	<div class="vertical-section grid12-4 persistent-grid2-1">\r\n        <a href="{{store direct_url="downloadable/software.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/fortis/custom/landing/vert3.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark2 full-width">\r\n	            <h2 class="heading permanent">Dolor</h2>\r\n    	        <p class="permanent">Etiam neque velit blandit sed</p>\r\n        	    <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n    <br />\r\n    \r\n	<div class="vertical-section grid-full">\r\n		{{block type="catalog/product_new" products_count="8" block_name="See Also: Recommended New Products" template="catalog/product/new.phtml"}}\r\n	</div>\r\n</div>', '2012-10-04 14:41:08', '2013-07-11 11:51:15', 1),
(5, 'Category above collection', 'block_category_above_collection', '<div class="sample-block">Static CMS block displayed above list/grid of products. Put your own content here.</div>', '2012-10-04 14:41:09', '2012-10-22 10:40:05', 0),
(6, 'Footer primary bottom - social links', 'block_footer_primary_bottom_left', 'Placeholder for custom content: block_footer_primary_bottom_left', '2012-10-04 14:41:10', '2013-07-10 10:02:07', 0),
(7, 'Footer tarjetas', 'block_footer_payment', '<img src="{{media url="wysiwyg/infortis/fortis/custom/payment.gif}}" alt="Payment methods" title="Sample image with payment methods in your store" />', '2012-10-04 14:41:10', '2014-08-09 21:39:34', 1),
(8, 'Category below collection', 'block_category_below_collection', '<div class="nested-container hide-below-768">\r\n\r\n    <div class="page-banners clearer">\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/fortis/custom/banners/01.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/fortis/custom/banners/03.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n    </div>\r\n\r\n</div>', '2012-10-04 14:41:11', '2013-07-10 17:57:32', 0),
(9, 'Categoría encima colección vacía', 'block_category_above_empty_collection', '<div class="note-msg empty-catalog">\r\n\r\n	<h3>No hay productos que concuerden con la selección </h3>\r\n	Se trata de un bloque personalizado CMS muestra si la categoría está vacía.<br>\r\n	Usted puede reemplazar con cualquier contenido personalizado.\r\n</div>', '2012-10-04 14:41:11', '2014-08-11 06:14:23', 1),
(10, 'Producto fondo de la columna secundaria', 'block_product_secondary_bottom', '<div class="feature feature-icon-hover indent first">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin ">We''ll send product in 2 days. <a href="#">Read more...</a></p>\r\n</div>\r\n<div class="feature feature-icon-hover indent">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin ">Call us now for more info about our products.</p>\r\n</div>\r\n<div class="feature feature-icon-hover indent">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin ">Return purchased items, get your money back.</p>\r\n</div>\r\n<div class="feature feature-icon-hover indent last">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin ">Buy this product and earn 10 loyalty points!</p>\r\n</div>\r\n\r\n\r\n<!-- Build your own social bookmarks, for more details refer to: http://www.addthis.com/get/sharing -->\r\n<!-- Remove HTML comment around the icons in order to display the icons on product page-->\r\n<!--\r\n<div class="feature-wrapper top-border">\r\n	<div class="addthis_toolbox addthis_default_style ">\r\n	<a class="addthis_button_preferred_1"></a>\r\n	<a class="addthis_button_preferred_2"></a>\r\n	<a class="addthis_button_preferred_3"></a>\r\n	<a class="addthis_button_preferred_4"></a>\r\n	<a class="addthis_button_compact"></a>\r\n	<a class="addthis_counter addthis_bubble_style"></a>\r\n	</div>\r\n	<script type="text/javascript" src="http://s7.addthis.com/js/300/addthis_widget.js#pubid=xa-5054e6c6502d114f"></script>\r\n</div>\r\n-->', '2012-10-04 14:41:12', '2014-08-11 06:15:11', 1),
(11, 'Product - primary column bottom', 'block_product_primary_bottom', 'CMS block - put your own content here. Product page, primary column bottom.', '2012-10-04 14:41:12', '2013-04-26 11:57:17', 0),
(12, 'Carrito - a continuación los totales', 'block_cart_below_totals', '<p><img style="float: right;" title="Sample info about SSL Certificate. Put your own content here." src="{{media url="wysiwyg/infortis/fortis/custom/block_cart_below_totals.png"}}" alt="SSL Image Example" /></p>', '2012-10-04 14:41:13', '2014-08-11 06:15:52', 1),
(13, 'One page checkout  below progress', 'block_opc_below_progress', '<div class="sample-block">Custom CMS block displayed below the one page checkout progress block. Put your own content here.</div>', '2012-10-04 14:41:14', '2014-09-03 08:25:13', 0),
(14, 'Mini cart above products', 'block_mini_cart_above_products', '<div style="padding:15px; background-color:#f5f5f5; color:#d90000;" title="Customizable CMS block for promo info">\r\n<a class="go" href="{{store url=""}}">Check our latest super promotions!</a>\r\n</div>', '2012-10-04 14:41:14', '2013-06-28 09:10:54', 0),
(15, 'Custom Tab 1', 'block_product_tab1', '<p>Custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\r\n\r\n<div class="feature indent first">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin"><strong>Magento Community Edition is the most powerful</strong> open source e-commerce software and can be downloaded 100% for free. Developers can modify the core code, add custom features and functionality by installing extensions from Magento Connect marketplace.</p>\r\n</div>\r\n<div class="feature indent">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin"><strong>Manage the fully dynamic catalog</strong> with the intutive admistrative interface. The flexible catalog system includes various options for the display of items. Magento is also integrated with a variety of major payment gateways out of the box.</p>\r\n</div>\r\n<div class="feature indent last">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin"><strong>Magento is a fully global platform</strong>, allowing for the expansion of business or simply offering multiple versions of your site to meet the needs of your customers.\r\nTranslated into over 60 languages, supporting multiple currencies, payment methods and taxes, Magento allows for internationalization of your online stores.</p>\r\n</div>', '2012-10-04 14:41:15', '2014-09-05 08:11:18', 0),
(16, 'Custom Tab 2', 'block_product_tab2', '<p>Another custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\r\n\r\n<p>Lorem ipsum dolor sit, consectetur adipiscing elit. Etiam neque velit, blandit sed scelerisque quis. Nullam ornare enim nec justo bibendum lobortis. In eget metus.</p>', '2012-10-04 14:41:15', '2013-04-07 21:12:02', 0),
(17, 'Cart - below table', 'block_cart_below_table', '<div class="nested-container hide-below-768">\r\n\r\n    <div class="page-banners clearer">\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Static CMS block displayed below the cart. Put your own content here.">\r\n                <img src="{{media url="wysiwyg/infortis/fortis/custom/banners/01.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Static CMS block displayed below the cart. Put your own content here.">\r\n                <img src="{{media url="wysiwyg/infortis/fortis/custom/banners/02.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n    </div>\r\n\r\n</div>', '2012-10-04 14:41:16', '2013-07-10 08:13:21', 0),
