(24, 'Custom', 'block_header_nav_dropdown', '<div class="grid-container-spaced">\r\n<div class="grid12-3">\r\n<h2 class="heading">Responsive Magento Theme</h2>\r\n<p>Fortis is a premium Magento theme with advanced admin module. It''s fully responsive and extremely customizable.</p>\r\n<h5><a class="go" style="color: red;" href="http://themeforest.net/item/fortis-flexible-magento-theme/1744309?ref=infortis">Buy this Magento theme</a></h5>\r\n</div>\r\n<div class="grid12-3"><a href="{{store url=''fortis-responsive-magento-theme''}}"> <img class="fade-on-hover" src="{{media url=''wysiwyg/infortis/fortis/menu/custom/01.png''}}" alt="Magento CMS blocks" /> </a>\r\n<h4 class="heading">50+ CMS blocks</h4>\r\n<p>You can use CMS blocks as content placeholders to display custom content in almost every part of the store. Import sample CMS blocks from the demo.</p>\r\n<a class="go" href="{{store url=''fortis-responsive-magento-theme''}}">See all features</a></div>\r\n<div class="grid12-3"><a href="{{store url=''fortis-responsive-magento-theme''}}"> <img class="fade-on-hover" src="{{media url=''wysiwyg/infortis/fortis/menu/custom/02.png''}}" alt="Magento theme documentation" /> </a>\r\n<h4 class="heading">190-pages documentation</h4>\r\n<p>The best Magento theme documentation on ThemeForest. It also describes selected Magento features which you need to know when starting to work with Magento.</p>\r\n<a class="go" href="{{store url=''fortis-responsive-magento-theme''}}">See all features</a></div>\r\n<div class="grid12-3"><a href="{{store url=''fortis-responsive-magento-theme''}}"> <img class="fade-on-hover" src="{{media url=''wysiwyg/infortis/fortis/menu/custom/03.png''}}" alt="Create Magento sub-themes" /> </a>\r\n<h4 class="heading">Easy to customize</h4>\r\n<p>Use Ultimo as a starting point for your custom projects. Unlike many other themes, Ultimo lets you create multiple custom sub-themes (theme variants) for your clients.</p>\r\n<a class="go" href="{{store url=''fortis-responsive-magento-theme''}}">See all features</a></div>\r\n</div>', '2012-10-04 14:41:19', '2014-08-07 23:27:43', 0),
(25, 'CMS page top', 'block_cms_page_top', '<div class="nested-container">\r\n\r\n    <div class="page-banners clearer">\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/01.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/02.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n\r\n    </div>\r\n\r\n</div>', '2012-10-04 14:41:20', '2013-01-15 13:19:32', 0),
(26, 'Product replace related', 'block_product_replace_related', '<div class="block">\r\n	<div class="block-title">\r\n		<strong><span>Replace related</span></strong>\r\n	</div>\r\n\r\n	<p style="margin:10px;">\r\n		Custom CMS block replacing related products. Put your own content here: text, HTML, images - whatever you want.\r\n	</p>\r\n	<p style="margin:10px;">\r\n		There are many similar blocks accross the store. All editable from admin panel.\r\n	</p>\r\n</div>', '2012-10-04 14:41:20', '2013-07-09 10:01:06', 1),
(27, 'Product replace up-sell', 'block_product_replace_upsell', '<div class="sample-block">Custom CMS block displayed when you want to replace up-sell products with custom content. You can put here simple text, images, HTML or whatever you like.</div>', '2012-10-04 14:41:21', '2012-12-10 12:19:38', 1),
(28, 'Header top left 2', 'block_header_top_left2', '<div class="links-wrapper-separators">\r\n<ul class="links">\r\n<li class="first hide-below-480"><a title="See more demos" href="http://fortis.infortis-themes.com/demo/select-demo/">All demos</a></li>\r\n<li class="hide-below-768"><a title="See the list of all features" href="{{store url=''fortis-responsive-magento-theme''}}">Features</a></li>\r\n<li class="last hide-below-480"><a title="Click to buy this theme" href="http://themeforest.net/item/fortis-responsive-magento-theme/1744309?ref=infortis">Buy me!</a></li>\r\n</ul>\r\n</div>', '2012-10-04 14:41:21', '2014-08-06 08:23:05', 0),
