(32, 'Submenu de los valores', 'block_right_top', '<style type="text/css">\r\n    @font-face {\r\n        font-family: Aleo-Italic;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/aleo/Aleo-Italic.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Regular;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/benton/BentonSans-Regular.otf);\r\n    }\r\n</style>\r\n<div class="block">\r\n<div class="block-title" style="background: #5b7fb3;color: white;text-align: center;">\r\n    <strong><span style="font-family:Aleo-Italic;font-size:14px;">Visi&oacute;n</span></strong>\r\n</div>\r\n<div class="block-content sample-block" style="color:#4b6480;font-family:BentonSans-Regular;font-size:13px;">Ser la mejor opción de importación de artículos promocionales y para el hogar. Ofrecer artículos innovadores con la mejor calidad y precio. Hacer de nuestra intención, un compromiso para nuestros clientes, brindarles expansión y difusión de sus marcas e imagen, con la finalidad de crecer juntos como socios y aliados.</div>\r\n\r\n<div class="block-title" style="background: #eb6c6c;color: white;text-align: center;">\r\n    <strong><span style="font-family:Aleo-Italic;font-size:14px;">Misi&oacute;n</span></strong>\r\n</div>\r\n<div class="block-content sample-block" style="color:#4b6480;font-family:BentonSans-Regular;font-size:13px;">Brindar el mejor servicio, entregas con calidad, tiempo, eficiencia, son parte de la calidad doble vela. Trabajamos en equipo para alcanzar la excelencia. Buscamos retos para lograr el éxito optimizando la atención a nuestros socios internos y externos visualizando los negocios como una alianza.</div>\r\n</div>', '2012-10-04 14:41:23', '2014-11-21 09:28:43', 1),
(34, 'Custom Top Links (to replace Magento''s default Top Links)', 'block_header_top_links', '<ul class="links">\r\n\r\n	<li class="first">\r\n		<a href="#" class="feature-icon-hover" title="My Title">\r\n			<span class="icon force-no-bg-color">\r\n				<img src="{{media url=''wysiwyg/infortis/fortis/icons/star.png''}}" alt="My description" />\r\n			</span>\r\n			<span class="label">My Link</span>\r\n		</a>\r\n	</li>\r\n	<li>\r\n		<a href="#" class="feature-icon-hover" title="My Title">\r\n			<span class="icon force-no-bg-color">\r\n				<img src="{{media url=''wysiwyg/infortis/fortis/icons/promo.png''}}" alt="My description" />\r\n			</span>\r\n			<span class="label">My Link</span>\r\n		</a>\r\n	</li>\r\n	<li class="last">\r\n		<a href="{{store url=''about-magento-demo-store''}}" class="feature-icon-hover" title="My Title">\r\n			<span class="icon force-no-bg-color i-twitter-w"></span>\r\n			<span class="label">My Link</span>\r\n		</a>\r\n	</li>\r\n\r\n</ul>', '2012-10-04 14:41:24', '2014-04-07 17:52:14', 0),
