(68, 'Submenu Filosofia', 'block_right_bottom', '<style type="text/css">\r\n    @font-face {\r\n        font-family: Aleo-Italic;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/aleo/Aleo-Italic.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Regular;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/benton/BentonSans-Regular.otf);\r\n    }\r\n</style>\r\n<div class="block">\r\n<div class="block-title" style="background:#5b7fb3;color:white;text-align:center;"><strong><span style="font-family:Aleo-Italic;font-size:14px;">Filosofía</span></strong></div>\r\n<div class="block-content sample-block">\r\n<p style="color:#4b6480;font-family:BentonSans-Regular;font-size:13px;">Nuestro mayor valor es el capital humano; Nuestra base: Servicio e Innovación; Nuestra fuerza: Honestidad y Gratitud.\r\nRepresentamos una fuente de trabajo firme y segura para el bienestar de nuestros colaboradores instalaciones.</p>\r\n</div>\r\n</div>', '2013-01-15 13:06:34', '2014-11-06 23:16:54', 1),
