INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 No Existe', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-title"><h1>¡Ups, no existe...</h1></div>\r\n<dl>\r\n<dt>La página solicitada no fue encontrado, y tenemos una buena conjetura qué.</dt>\r\n<dd>\r\n<ul class="disc">\r\n<li>Si escribió la dirección URL directamente, por favor asegúrese de que la ortografía es correcta.</li>\r\n<li>Si ha hecho clic en un enlace para llegar aquí, el enlace no está actualizado.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>¿Qué puedes hacer?</dt>\r\n<dd>No tengas miedo, la ayuda está cerca! Hay muchas maneras que usted puede volver a la pista con Doble Vela.</dd>\r\n<dd>\r\n<ul class="disc">\r\n<li><a href="#" onclick="history.go(-1); return false;">volver</a>a la página anterior.</li>\r\n<li>Utilice la barra de búsqueda en la parte superior de la página para buscar sus productos.</li>\r\n<li>Siga estos enlaces para ayudarle a volver a la pista!<br /><a href="{{store url=""}}">Home</a> <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li></ul></dd></dl>\r\n', '2012-09-18 11:34:21', '2014-08-22 09:34:01', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Doble Vela, Artículos Promocionales', 'one_column', NULL, NULL, 'home', NULL, '<div class="grid12-4 home_mobile a_mobile" style="margin-left: -4%;width: 25%;">\r\n    <div class="feature large centered" style="color: #808080 !important;">\r\n        <span class="icon auto-size no-bg-color"> \r\n            <img src="{{media url=''wysiwyg/infortis/fortis/icons/ico1.png''}}" alt="Customizable design" /> \r\n        </span>\r\n        <h3 style="font-size:18px;">CATÁLOGOS</h3>\r\n        <p class="parrafos_home_menu">Conoce aquí los requisitos.<br>Concerta una cita.<br>Contacta a un ejecutivo.</p>\r\n        <a style="cursor:pointer;color: #808080 !important;" href="#">\r\n            Descarga PDF <span style="width:5px;"></span><a style="cursor:pointer;padding: 15px;" class="go_x"></a>\r\n        </a>\r\n    </div>\r\n</div>\r\n<div class="grid12-4 home_mobile" style="margin-left: 0%;width: 25%;">\r\n    <div class="feature large centered" style="color: #808080 !important;"><span class="icon auto-size no-bg-color"> <img src="{{media url=''wysiwyg/infortis/fortis/icons/ico2.png''}}" alt="Customizable design" /> </span>\r\n        <h3 style="font-size:18px;">SÉ DISTRIBUIDOR</h3>\r\n        <p class="parrafos_home_menu">Conoce aquí los requisitos.<br>Concerta una cita.<br>Contacta a un ejecutivo.</p>\r\n        <a style="cursor:pointer;color: #808080 !important;" href="{{config path="web/unsecure/base_url"}}Distribuidor">\r\n            Lee más <span style="width:5px;"></span>\r\n            <a style="cursor:pointer;padding: 15px;" class="go_x" href="{{config path="web/unsecure/base_url"}}Distribuidor"></a> \r\n        </a>\r\n    </div>\r\n</div>\r\n<div class="grid12-4 home_mobile" style="margin-left: 0%;width: 25%;">\r\n    <div class="feature large centered" style="color: #808080 !important;"><span class="icon auto-size no-bg-color"> <img src="{{media url=''wysiwyg/infortis/fortis/icons/ico3.png''}}" alt="Customizable design" /> </span>\r\n    <h3 style="font-si