(5, 'Enable Cookies', 'two_columns_right', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\r\n    <ul class="messages">\r\n        <li class="notice-msg">\r\n            <ul>\r\n                <li>Please enable cookies in your web browser to continue.</li>\r\n            </ul>\r\n        </li>\r\n    </ul>\r\n    <div class="page-title">\r\n        <h1><a name="top"></a>What are Cookies?</h1>\r\n    </div>\r\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website. On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically whenever you visit our site so that we can personalize your experience and provide you with better service. We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes. If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase or take advantage of certain features of our website, such as storing items in your Shopping Cart or receiving personalized recommendations. As a result, we strongly encourage you to configure your web browser to accept cookies from our website.</p>\r\n    <h2 class="subtitle">Enabling Cookies</h2>\r\n    <ul class="disc">\r\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\r\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\r\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\r\n        <li><a href="#opera">Opera 7.x</a></li>\r\n    </ul>\r\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Start Internet Explorer</p>\r\n        </li>\r\n        <li>\r\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Privacy</strong> tab</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Advanced</strong> button</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>, put another check mark in the <strong>Always accept session cookies </strong>box</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Restart Internet Explore</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\r\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> tab</p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>) under <strong>Settings</strong>. Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Expand the <strong>Cookies</strong> section</p>\r\n        </li>\r\n        <li>\r\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="opera"></a>Opera 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong> should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n</div>\r\n', '2012-09-18 11:34:21', '2012-10-22 08:55:16', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Politicas', 'one_column', NULL, NULL, 'politicas', NULL, '<style type="text/css">\r\n    @font-face {\r\n        font-family: BentonSans-Book;\r\n        src: url(skin/frontend/fortis/default/css/fonts/benton/BentonSans-Book.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Regular;\r\n        src: url(skin/frontend/fortis/default/css/fonts/benton/BentonSans-Regular.otf);\r\n    }\r\n\r\n    @font-face {\r\n        font-family: Aleo-Regular;\r\n        src: url(skin/frontend/fortis/default/css/fonts/aleo/Aleo-Regular.otf);\r\n    }\r\n\r\n    .degradado_politicas{\r\n        background:url(''media/politicas/pleca_politicas.png'');\r\n        height: 179px;\r\n        width: 100%;\r\n    }\r\n    .espaciador_politicas{\r\n        float:left;\r\n        height:10px;\r\n        min-width:25px;\r\n    }\r\n    .fila_a{\r\n        margin-top:-60px;\r\n    }\r\n    .fila_b{\r\n        margin-top:-5px;\r\n    }\r\n    .flecha_politica{\r\n        border-top: 10px solid #0080C0;\r\n        border-left: 10px solid transparent;\r\n        border-right: 10px solid transparent;\r\n        cursor:pointer;\r\n        height: 0;\r\n        margin-left: 194px;\r\n        width: 0;\r\n    }\r\n    .flecha_volteada{\r\n        border-bottom: 10px solid #0080C0;\r\n        border-left: 10px solid transparent;\r\n        border-right: 10px solid transparent;\r\n        cursor:pointer;\r\n        display:none;\r\n        height: 0;\r\n        margin-left: 194px;\r\n        margin-top: -11px;\r\n        width: 0;\r\n    }\r\n    .leer_mas{\r\n        border-bottom:solid 1px #849fc4;\r\n        color:#849fc4;\r\n        font-family: BentonSans-Regular;    \r\n        font-size: 12.58px;\r\n    }\r\n    .parrafo_oculto{\r\n        background:white;\r\n        display:none;\r\n        font-family: BentonSans-Book;    \r\n        font-size: 14px;\r\n    }\r\n   .politicas_individuales{\r\n        float: left;\r\n        height: 360px;\r\n        width: 215px;\r\n        word-wrap:break-word;\r\n   }\r\n   .politicas_individuales p{\r\n        font-family: BentonSans-Book;\r\n        font-size: 14px;\r\n        padding-left: 3px;\r\n        text-align: left;\r\n        word-spacing: 5px;\r\n        word-wrap: break-word;\r\n   }\r\n   .politicasUL {\r\n        margin: 0px;\r\n        padding-left: 10px;\r\n        padding-right: 3px;\r\n    }\r\n   .title_politicas_ind{\r\n        color:#293f61;\r\n        font-family: Aleo-Regular; \r\n        font-size: 18px;\r\n        margin-top: -113px;\r\n        padding: 15px;\r\n        text-align: center;\r\n   }\r\n</style>\r\n<div align="left">\r\n    <h1>\r\n        <b style="font-family:Aleo-Regular;font-size:31px">Políticas</b>&#32;\r\n        <span style="color:#4D4D4D;font-family: BentonSans-Book;font-size:16px;">Winideas, S.A. de C.V.</span></h1>\r\n</div>\r\n<!-- Inicio fila a -->\r\n<div class="politicas_individuales fila_a"  id="a">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind">Garantía de productos</div>\r\n    <br>\r\n    <p>\r\n        Todos los productos que vende- mos se entregan nuevos, directa- mente de fábrica, y tienen una GARANTÍA de 10 días naturales a partir de la fecha de entrega, aplicable sobre cualquier defecto de manufactura.\r\n    </p>\r\n    <p class="parrafo_oculto" id="a">\r\n        <br>\r\n        En caso de existir defectos o mal funcionamiento, todo producto será repuesto por el mismo modelo o por otro del mismo precio.\r\n        <br>\r\n        <b style="color:black;font-size:10px;">LA GARANTÍA NO APLICA CUANDO:</b><br>\r\n        Si los artículos por los cuales se pide cambio se encuentran sobre usados o maltratados, o por daños que cause el cliente o terceros contratados, al abrir, transportar o almacenar y manipular los productos. Si los artículos presentan alteraciones físicas o han sido manipulados, por ejemplo: impresos en cualquiera de sus formas, grabados o serigrafiados.\r\n        <br><br>\r\n    </p>\r\n    <div align="right" class="leer_mas" id="a">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="a">&nbsp;</div>\r\n    <div class="flecha_volteada" id="a">&nbsp;</div>\r\n</div>\r\n\r\n<div class="espaciador_politicas"></div>\r\n\r\n<div class="politicas_individuales fila_a"  id="b">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind">Nuestros precios</div>\r\n    <br>\r\n    <p>\r\n        Nuestros precios son los más bajos del mercado en la venta de artículos promocionales, y Los ponemos a sus disposición a través de nuestra "Lista de Precios", vía solicitud a su ejecutivo de venta, la cuál se expresa en Moneda Na-\r\n    </p>\r\n    <p class="parrafo_oculto" id="b">\r\n        cional a la fecha actual. (no incluye I.V.A.).<br>\r\n        <b style="color:black;font-size:10px;">IGUALAMOS Y MEJORAMOS PRECIOS:</b><br>\r\n        Le reiteramos que, si usted cuenta con una legítima cotización de la competencia (por escrito) con un precio más bajo en uno o varios productos iguales a los nuestros, LE IGUALAMOS O MEJORAMOS EL PRECIO además de ofrecerle un inmejorable servicio y garantía.<br>\r\n        <b style="color:black;font-size:10px;">PRECIOS GARANTIZADOS:</b><br>\r\n        Con esta estrategia, le garantizamos que usted puede sentirse tranquilo al adquirir sus productos con nosotros. Los precios publicados en esta página se actualizan constantemente y no se requiere de su confirmación a su ejecutivo de venta. (no incluyen I.V.A.).   \r\n    </p>\r\n    <div align="right" class="leer_mas" id="b">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="b">&nbsp;</div>\r\n    <div class="flecha_volteada" id="b">&nbsp;</div>\r\n</div>\r\n\r\n<div class="espaciador_politicas"></div>\r\n\r\n<div class="politicas_individuales fila_a"  id="c">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind">Condiciones de pago</div>\r\n    <br>\r\n    <p>\r\n        Todo pedido deberá liquidarse previo a la entrega, las formas de pago son:<br><br>\r\n        <span style="color:#3060ad;">Depósito en efectivo</span><br><br>\r\n        <span>Transferencia electrónica por:</span><br>\r\n        <span style="color:#3060ad;">Bancomer - Banamex (solicitar</span>\r\n    </p>\r\n    <p class="parrafo_oculto" id="c">\r\n        CLABE).<br>\r\n        <span style="color:#3060ad;">Tarjeta de crédito y débito (directo en oficina)</span>\r\n        La entrega o envió de su mercancía se realizará 24 horas después de confirmar con el banco su deposito o transferencia bancaria.\r\n        <br>\r\n        En venta de artículos especiales ó impresos, se requiere de anticipo del 50% incluyendo el IVA. y liquidar antes del embarque de los productos.\r\n    </p>\r\n    <div align="right" class="leer_mas" id="c">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="c">&nbsp;</div>\r\n    <div class="flecha_volteada" id="c">&nbsp;</div>\r\n</div>\r\n\r\n<div class="espaciador_politicas"></div>\r\n\r\n<div class="politicas_individuales fila_a"  id="d">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind">Venta de muestras</div>\r\n    <br>\r\n    <p>\r\n        Nuestras políticas de venta son las siguientes:<br>\r\n        - La venta de muestras se realiza al público en general desde una pieza a precio de muestra<br>\r\n        - No se prestan productos para muestra sin excepción alguna.\r\n    </p>\r\n    <p class="parrafo_oculto" id="d">\r\n        - No se realiza cambió físico ni se aceptan devoluciones por venta de muestra\r\n        - Monto mínimo a FACTURAR por la venta de muestra es por la cantidad de $500.00 (quinientos pesos 00/100 M.N.) + IVA\r\n        - Monto menores a esa cantidad la empresa emite REMISION y el Pago es de contado\r\n    </p>\r\n    <div align="right" class="leer_mas" id="d">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="d">&nbsp;</div>\r\n    <div class="flecha_volteada" id="d">&nbsp;</div>\r\n</div>\r\n\r\n<!-- Fin fila a -->\r\n<!-- Inicio fila b -->\r\n<div class="politicas_individuales fila_b"  id="e">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind">Política de descuentos</div>\r\n    <br>\r\n    <p>\r\n        Estimado cliente es importante que usted se dirija directamente con su ejecutivo de cuenta para conocer nuestros montos de descuentos, los cuáles resultan atractivos de acuerdo al monto total de su compra.\r\n    </p>\r\n    <div align="right" class="leer_mas" id="e">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="e">&nbsp;</div>\r\n    <div class="flecha_volteada" id="e">&nbsp;</div>\r\n</div>\r\n\r\n<div class="espaciador_politicas"></div>\r\n\r\n<div class="politicas_individuales fila_b"  id="z">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind">Productos especiales</div>\r\n    <br>\r\n    <p>\r\n        Grupo Doble Vela pone a su disposición un departamento de proyectos especiales (modelos exclusivos), en el cual le ofrecemos productos novedosos y vanguardistas.\r\n        <br><br><br>\r\n    </p>\r\n    <div align="right" class="leer_mas" id="z">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="z">&nbsp;</div>\r\n    <div class="flecha_volteada" id="z">&nbsp;</div>\r\n</div>\r\n<!-- Fin fila b -->\r\n<div style="clear:both;"></div>\r\n<!-- inicio fila c -->\r\n<div align="left">\r\n    <h1 style="color:red;font-family:Aleo-Regular;font-size:25px">\r\n        Entregas a domicilio y localidades de entregas foráneas.\r\n    </h1>\r\n</div>\r\n\r\n<div class="politicas_individuales fila_a"  id="f">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind" style="font-size:16px;">DF y Área Metropolitana</div>\r\n    <br>\r\n    <p>\r\n        Una vez confirmado su pago nos responsabilizamos a entregar en su domicilio por ventas mayores a $11,000.00 + IVA \r\n        (Once mil pesos 00/100 M.N.). Entregamos en ciertas delegaciones del D.F. y municipios del área metropolitana. \r\n        (Pregunte    \r\n    </p>\r\n    <p class="parrafo_oculto" id="f">\r\n        a su ejecutivo por nuestras localidades de entrega).<br>\r\n        <span style="color:black;font-weight:bold;">\r\n            *Entregas que se realicen en localidades que no cubran nuestro alcance geográfico marcado por la empresa, \r\n            se cobrará como flete un mínimo de $300.00 más IVA.\r\n        </span><br><br>\r\n        <span style="color:black;font-weight:bold;">\r\n            *Nuestras entregas de mercancía a domicilio se realizan a pie de camión.\r\n        </span><br><br>\r\n        En ventas menores a dicha cantidad, el cliente deberá recoger en nuestras instalaciones en el horario de \r\n        09:00 a 18:00 hrs. o solicitar con su ejecutivo de venta nuestro servicio de flete, pagando la cantidad de $300.00 \r\n        (Trescientos Pesos 00/100 M.N.) + IVA., depositando en nuestras cuentas bancarias o pago en efectivo previo a la \r\n        entrega.<br><br>\r\n        <span style="color:black;font-weight:bold;text-decoration:underline;">Clientes Foráneos:</span> Enviamos desde una muestra \r\n        hasta la cantidad solicitada, los embarques se realizan por cobrar utilizando el medio de transporte que al cliente le \r\n        convenga, corriendo por cuenta propia del cliente. Nosotros le damos la opción de trabajar con nuestros transportes \r\n        confiables.<br><br> \r\n        <span style="color:black;font-weight:bold;text-decoration:underline;">Tiempos de entrega:</span><br>\r\n        <span> - Local: Compras realizadas y pagadas antes de las 11:00 de la mañana entregamos mismo día por la tarde.\r\n                (después de ese horario, día siguiente)\r\n        </span><br>\r\n        <span> - Foráneos: Si usted solicitó antes de las 11:00 hrs. entregamos 24 hrs. después dependiendo del transporte \r\n            solicitado y distancia.\r\n        </span>\r\n    </p>\r\n    <div align="right" class="leer_mas" id="f">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="f">&nbsp;</div>\r\n    <div class="flecha_volteada" id="f">&nbsp;</div>\r\n</div>\r\n\r\n<div class="espaciador_politicas"></div>\r\n\r\n<div class="politicas_individuales fila_a"  id="g">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind" style="font-size:16px;">Guadalajara y Monterrey</div>\r\n    <br>\r\n    <p>\r\n        Grupo Doble Vela le envía gratis su mercancía hasta la ciudad de Guadalajara, Jal. y también a Monterrey, N.L. Como un \r\n        beneficio adicional al realizar compras mayores a $6,000.00(seis mil pesos 00/100) + IVA, en un número de    \r\n    </p>\r\n    <p class="parrafo_oculto" id="g">\r\n        cajas sea mayor a Cinco. El envío correrá a cargo de la empresa a estas dos ciudades. TIEMPO DE ENTREGA: \r\n        Después de liquidar el pago de su mercancía, usted recibirá durante las próximas 24 hrs. en su domicilio o en el \r\n        domicilio solicitado a nuestro ejecutivo de ventas, dentro de la ciudad de Guadalajara. Ver relación de localidades que \r\n        cubre nuestra paquetería para la entrega a domicilio. En caso de no cubrir la entrega a domicilio, la entrega será en las \r\n        direcciones que ofrece Doble Vela.Consulte con su ejecutivo la sucursal más cercana a su domicilio, para que se realice a \r\n        esta el embarque. Los servicios de paquetería contratados por Grupo Doble Vela se realizan por la empresa TRAVISA \r\n        (Auto transportes Villareal, S.A .de CV), por favor de tomar en cuenta para no ser sorprendidos por otra empresa. \r\n        Relación de localidades que cubre nuestra paquetería para la entrega a domicilio y sucursales de TRAVISA en Guadalajara y \r\n        Monterrey.\r\n    </p>\r\n    <div align="right" class="leer_mas" id="g">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="g">&nbsp;</div>\r\n    <div class="flecha_volteada" id="g">&nbsp;</div>\r\n</div>\r\n\r\n<div class="espaciador_politicas"></div>\r\n\r\n<div class="politicas_individuales fila_a"  id="h">\r\n    <br>\r\n    <div class="degradado_politicas"></div>\r\n    <div class="title_politicas_ind" style="font-size:16px;">Consideraciones</div>\r\n    <br>\r\n    <p>\r\n        Nuestro departamento de atención a clientes, le hará llegar su número de guía, vía e-mail o por teléfono, para el \r\n        seguimiento de su mercancía.\r\n    </p><br><br><br><br>\r\n    <div align="right" class="leer_mas" id="h">\r\n        <span>Leer más</span>\r\n    </div>\r\n    <div class="flecha_politica" id="h">&nbsp;</div>\r\n    <div class="flecha_volteada" id="h">&nbsp;</div>\r\n</div>\r\n<!-- fin fila c -->\r\n\r\n<div style="clear:both;"></div>\r\n<!-- Inicio fila d -->\r\n\r\n<div align="left">\r\n    <h1 style="color:red;font-family:BentonSans-Book;font-size:25px;">\r\n        Políticas de Devoluciones y/o cambio físico de mercancías.\r\n    </h1>\r\n</div>\r\n\r\n<p style="color:#4D4D4D;font-family:BentonSans;font-size:14px;text-align:left;">\r\n    Queremos que nuestros clientes estén satisfechos con la calidad de nuestra mercancía, de lo contrario si nuestra mercancía \r\n    no cubrió sus expectativas le presentamos a ustedes nuestros términos y condiciones para efectuar devolución y/o cambio de \r\n    la misma.\r\n</p>\r\n<p style="color:#4D4D4D;font-family:BentonSans;font-size:14px;text-align:left;">\r\n    Debe tomar en cuenta que en los siguientes casos NO procedemos a efectuar devolución ni cambios físicos de mercancía:<br> \r\n    1. Cuando la mercancía presente alteraciones o haya sido manipulado, por ejemplo: impresión, grabado, serigrafía o cualquier \r\n    otro tipo de sistema de impresión o grabado.<br>\r\n    2. Cuando el producto corresponda a mercancía obsoleta, descontinuada o saldo.<br>\r\n    3. En caso de que los productos no estén completos, en sus cajas y/o empaques originales, y en su caso, por no tener los \r\n    códigos de barras, por no contener todos los manuales y documentación y otros accesorios suministrados por el fabricante.<br>\r\n    4. La mercancía esté sobre usada, maltratada o por daños causados por el cliente al transportar, almacenar o manipular los \r\n    productos.<br>\r\n    5. Después de transcurridos 10 días naturales después de la fecha de entrega de la mercancía.\r\n</p>\r\n<p style="color:#4D4D4D;font-family:BentonSans;font-size:14px;text-align:left;">\r\n    ESTIMADO CLIENTE, ANTES DE SOLICITAR SU DEVOLUCION Y/O CAMBIO FISICO, DEBE TOMAR EN CUENTA LOS SIGUIENTES PUNTOS:<br>\r\n    1. En caso de no contar con la mercancía solicitada, la empresa le hará llegar una solución, y si no cubrimos sus expectativas \r\n    de compra, se le extenderá una Nota de crédito para compras posteriores.<br>\r\n    2. En caso de solicitar mercancía errónea y NO sea nuestra responsabilidad, o bien, se trate de una cancelación por parte de \r\n    su cliente final y posterior al periodo de 10 días naturales a partir de la fecha de entrega; los gastos generados por el \r\n    cambio y/o devolución corren por su cuenta como fletes, paquetería y/o cualquier otro gasto que se genere por ello. Además, \r\n    de un cobro adicional del 5% como mínimo del valor total de la mercancía incluyendo IVA por gastos administrativos.<br>\r\n    3. Si al momento de recibir su mercancía se percató que los sellos (cinta impresa, flejes, sello de seguridad) estaban \r\n    violados, las cajas abiertas, y/o cualquier anomalía en el empaque; por favor repórtelo de inmediato al Departamento de \r\n    Devoluciones, para que tome en cuenta dicha situación en caso de existir algún faltante y/u otro tipo de reclamación.\r\n</p>\r\n<p style="color:#4D4D4D;font-family:BentonSans;font-size:14px;text-align:left;">\r\n    PARA DEVOLUCIONES EN EL D.F. Y ÁREA METROPOLITANA.<br>\r\n    Pasos a seguir, para solicitar la devolución y/o cambio físico de Mercancía:<br>\r\n    1. El cliente deberá repórtalo directamente con su EJECUTIVO DE CUENTA, antes de un periodo de 10 días naturales, después de la \r\n    entrega de la mercancía.<br>\r\n    2. Deberá de hacer llegar una carta de aclaración, ya sea vía e-mail, fax o entregar directamente en nuestras instalaciones, en \r\n    la cual detallará la causa de la devolución y/o cambio físico e indicar número de factura y/o número de pedido a la que \r\n    corresponde la mercancía; producto a devolver o cambiar, especificando la cantidad de unidades; mencionar el modelo \r\n    solicitado en origen y por último; especificar color y unidades (número de piezas).<br>\r\n    3. Posteriormente se informará vía e-mail o llamada telefónica la resolución acerca de su solicitud y en su caso, para dar \r\n    seguimiento con la devolución y/o cambio de mercancía.<br>\r\n    4. Una vez confirmada su petición, deberá entregar la mercancía en buenas condiciones, empaque original, etc. directamente \r\n    en las instalaciones de la empresa. Así mismo, tendrá que recogerla en dicho lugar.<br>\r\n    5. El horario de atención para la devolución y/o cambio físico es de lunes a viernes de 10:00 a 14:30 horas de Lunes a Viernes.\r\n</p>\r\n<p style="color:#4D4D4D;font-family:BentonSans;font-size:14px;text-align:left;">\r\n    PARA DEVOLUCIONES EN EL INTERIOR DE LA REPUBLICA.<br>\r\n    Pasos a seguir, para solicitar la devolución y/o cambio físico de Mercancía:<br>\r\n    1. El cliente deberá repórtalo directamente con su EJECUTIVO DE CUENTA, en un lapso de 10 días naturales a partir de la \r\n    entrega de la mercancía.\r\n    2. Deberá de hacer llegar una carta de aclaración, ya sea vía e-mail o fax, en la cual detallará la causa de la devolución \r\n    y/o cambio físico e indicar número de factura y/o número de pedido a la que corresponde la mercancía; producto a devolver o \r\n    cambiar, especificando la cantidad de unidades; mencionar el modelo solicitado en origen y por último; especificar color y \r\n    unidades (número de piezas).<br>\r\n    3. Al momento de hacer llegar su solicitud, se recomienda enviar y/o anexar fotos (antes de enviar su mercancía) en donde se \r\n    aprecie; de ser posible, en una sola imagen la cantidad de productos a devolver; en donde se denote defecto y una más, de las \r\n    cajas (frente y costados) para identificar el Número de Lote.<br>\r\n    4. Posteriormente informará vía e-mail o llamada telefónica la resolución acerca de su solicitud y en su caso, para dar \r\n    seguimiento con la devolución y/o cambio de mercancía.<br>\r\n    5. Una vez resuelta su solicitud, debe:\r\n</p>\r\n<p style="color:#4D4D4D;font-family:BentonSans;font-size:14px;text-align:left;margin-left:15px;margin-top:-10px;">\r\n    &#32;&#32;&#32;&#32; - Enviar la mercancía vía paquetería DIRECTAMENTE a nuestras instalaciones, asegurándose que ésta llegue \r\n    en óptimas condiciones.<br>\r\n    &#32;&#32;&#32;&#32; - Se recomienda enviar su mercancía a la Atención de su Ejecutivo de Cuenta e identificar sus cajas con \r\n    el Número de Folio asignado para su devolución y numeradas para una mejor identificación y control de las mismas.<br>\r\n    &#32;&#32;&#32;&#32; - Utilizar de preferencia la misma compañía de paquetería que le entregó la mercancía: TINY PACK y/o \r\n    TRAVISA. (NO pagamos fletes aéreos).<br>\r\n    &#32;&#32;&#32;&#32; - Al momento de recibir su mercancía, nos pondremos en contacto con usted para confirmar la reposición de \r\n    la mercancía.<br>\r\n</p>\r\n<p style="color:#4D4D4D;font-family:BentonSans;font-size:14px;text-align:left;">\r\n    NOTA: La empresa se hace responsable del cambio de la mercancía y cubre los gastos generados en fletes a consecuencia de:<br>\r\n    1. Haber enviado otra mercancía por equivocación.<br>\r\n    2. La mercancía presente algún defecto de fabricación.\r\n</p>\r\n\r\n<!-- Fin fila d -->\r\n\r\n<script src="js/infortis/jquery/jquery-1.7.2.min.js"></script>\r\n<script type="text/javascript">\r\n    $(document).ready(function(){\r\n\r\n        var id = null;\r\n\r\n        $(".flecha_volteada").click(function(){\r\n\r\n            id = $(this).attr("id");\r\n            \r\n            $(".parrafo_oculto#"+id).slideUp("slow");\r\n            $(".politicas_individuales.fila_a#"+id).css("position","inherit");\r\n            $(".leer_mas#"+id+" span").css("display","block");\r\n            $(".flecha_volteada#"+id).css("display","none");\r\n            $(".flecha_politica#"+id).css("display","block");\r\n        });\r\n\r\n        $(".flecha_politica").click(function(){\r\n\r\n            id = $(this).attr("id");\r\n            \r\n            $(".politicas_individuales.fila_a#"+id).css("position","relative");\r\n            $(".parrafo_oculto#"+id).slideDown("slow");\r\n            $(".leer_mas#"+id+" span").css("display","none");\r\n            $(".flecha_politica#"+id).css("display","none");\r\n            $(".flecha_volteada#"+id).css("display","block");\r\n        });\r\n    });\r\n</script>', '2012-09-18 11:34:21', '2014-11-07 01:59:12', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(23, 'Nosotros', 'two_columns_right', NULL, NULL, 'nosotros', NULL, '<style type="text/css">\r\n    @font-face {\r\n        font-family: BentonSans-Book;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/benton/BentonSans-Book.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Regular;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/benton/BentonSans-Regular.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Medium;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/benton/BentonSans-Medium.otf);\r\n    }\r\n    @font-face {\r\n        font-family: Aleo-Regular;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/aleo/Aleo-Regular.otf);\r\n    }\r\n</style>\r\n\r\n<div class="page-title">\r\n<h1>Quiénes somos</h1>\r\n</div>\r\n<h3 class="title_nosotros" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width:315px;">Doble Vela, importador confiable.</h3>\r\n<h3 class="title_nosotros" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width: 250px;">Siempre un paso adelante.</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n<p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\nGrupo Doble Vela, es un grupo comercial dedicado a la importación y venta de Artículos de Origen Chino en nuestro país desde hace 15 años.</p>\r\n</div>\r\n\r\n<br><br><br>\r\n<h3 class="title_nosotros" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width: 185px;">Zonas de influencia</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n<p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\nDesde México, China y Estados Unidos realiza operaciones comerciales y de importación.\r\n</p>\r\n</div>\r\n\r\n<br><br><br>\r\n<h3 class="title_nosotros" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width:425px;">Doble Vela cuenta con dos líneas comerciales</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n    <p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\n    <b>1.- SuperWin, SA de CV</b>. Se dedica a la venta de Artículos Domésticos y utensilios para la cocina y de temporada como: Navideña, Halloween, 14 de Febrero, y 10 de Mayo, vendiendo dichos artículos en prestigiadas cadenas de autoservicio del país.<br><br>\r\n    <b>2.- Winideas, SA de CV</b>. Se dedica a la venta de Artículos Promociónales contando con una amplia variedad donde podemos destacar: Tazas, Bolígrafos, Relojes, Llaveros, Termos, entre algunos, los cuales presentan diseños vanguardistas, ergonómicos e innovadores. Todos nuestros artículos pueden ser manipulados para procesos de Serigrafía, Tampografía, Grabado, Estampado o cualquier técnica de impresión de logotipos.\r\n    </p>\r\n</div>\r\n<br><br>\r\n<div class="nosotros_rosa" style="background:#f08185;height:110px;margin-top:137px;">\r\n    <img src="{{media url=''nosotros/nosotros_5razones.png''}}" alt="5 Razones" />\r\n</div>\r\n\r\n<br><br><br>\r\n<h3 class="title_nosotros optimizador" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width:200px;">Somos importadores</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n<p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\nEn Doble Vela ofrecemos grandes beneficios a nuestros clientes, ya que somos IMPORTADORES DIRECTOS.\r\n</p>\r\n</div>\r\n\r\n<br><br><br>\r\n<h3 class="title_nosotros" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width:360px;">Contamos con alto stock en productos</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n<p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\nTenemos trato directo con los fabricantes en China, lo que nos da la oportunidad de requerir especificaciones físicas o técnicas de cualquier producto, manejando la mejor calidad del mercado. Por estas condiciones disponemos de stock a partir de 500 piezas en adelante.\r\n</p>\r\n</div>\r\n\r\n<br><br><br><br>\r\n<h3 class="title_nosotros optimizador_a" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width:410px;">Ofrecemos garantía en nuestros productos.</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n<p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\nTenemos gran variedad de colores, materiales y modelos garantizando la entrega y funcionamiento de sus productos.\r\n(Ver políticas de cambio y devolución).\r\n</p>\r\n</div>\r\n\r\n<br><br><br>\r\n<h3 class="title_nosotros optimizador_b" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width:80px;">Servicio</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n<p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\nSabemos la importancia de dar un buen servicio, por ello nuestros ejecutivos de ventas están a su disposición para orientarlo, resolver cualquier duda y hacer eficiente su compra.\r\n</p>\r\n</div>\r\n\r\n<br><br><br>\r\n<h3 class="title_nosotros optimizador_c" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom:5px;padding-top:5px;padding-left:5px;width:195px;">Calidad sobre precio</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="width:100%;">\r\n<p class="aparece_max" style="font-family:BentonSans-Book;font-size:16px;margin-left: -8px;color:#808080 !important;">\r\nNuestra producción a volúmenes altos, nos da la oportunidad de ofrecer el mejor precio con CALIDAD garantizada..\r\n</p>\r\n</div>\r\n<input id="nosotros_active" name="nosotros_active" type="hidden" value="1" />', '2014-08-11 04:16:44', '2014-11-22 09:07:12', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(24, 'Impresiones', 'one_column', NULL, NULL, 'impresiones', NULL, '<style type="text/css">\r\n    @font-face {\r\n        font-family: Aleo-Regular;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/aleo/Aleo-Regular.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Regular;\r\n        src: url(../skin/frontend/fortis/default/css/fonts/benton/BentonSans-Regular.otf);\r\n    }\r\n</style>\r\n<div class="page-title">\r\n<h1>Tipos de impresión</h1>\r\n</div>\r\n\r\n{{block type=”cms/block” block_id=”identificador” template=”infortis/ultraslideshow/slideshow.phtml”}}\r\n{{block type=”cms/block” block_id=”ultraslideshow” template=”infortis/ultraslideshow/slideshow.phtml”}}\r\n\r\n{{block type="ultraslideshow/slideshow" template="infortis/ultraslideshow/slideshow.phtml"\r\nslides="block_slide_wide1,block_slide_wide2,block_slide_wide3,block_slide_wide4,block_slide_wide5,block_slide_wide6,block_slide_wide7,block_slide_wide8"}}\r\n\r\n\r\n<!--\r\n{{widget type="cms/widget_block" template="cms/widget/static_block/default.phtml" block_id="96"}}\r\n{{widget type="cms/widget_block" template="cms/widget/static_block/default.phtml" block_id="95"}}\r\n{{widget type="cms/widget_block" template="cms/widget/static_block/default.phtml" block_id="98"}}\r\n{{widget type="cms/widget_block" template="cms/widget/static_block/default.phtml" block_id="99"}}\r\n{{widget type="cms/widget_block" template="cms/widget/static_block/default.phtml" block_id="100"}}\r\n{{widget type="cms/widget_block" template="cms/widget/static_block/default.phtml" block_id="101"}}\r\n{{widget type="cms/widget_block" template="cms/widget/static_block/default.phtml" block_id="102"}}\r\n-->\r\n<br>\r\n<div class="grid12-8" style="width:89%;">\r\n    <p style="font-size: 15px;margin-left: 10px;">\r\n        Si requiere el servicio de impresión, consulte esta útil información o contacte a uno de nuestros ejecutivos en el área de ventas para conocer sobre los servicios que tenemos disponibles, será un placer ayudarle.\r\n    </p>\r\n</div>\r\n\r\n<div class="grid12-8">\r\n    <h3 style="background:#112e54;color:white;font-family:Aleo-Regular;padding-bottom:5px;padding-top:5px;text-align:center;width:135px;">SERIGRAFÍA</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        La serigrafía es un sistema de impresión basado en la transferencia de una imagen a través de una malla, se le aplica tinta y mediante un rasero se pasa a través de la malla para depositarse en el objeto a imprimir.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-88px;margin-left:607px;width:250px;">\r\n        <span style="color:#a6b1bd;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#5b7fb3;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Papel, metal, textil, vidrio, plástico y madera.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8">\r\n    <h3 style="background:#e3070e;color:white;font-family:Aleo-Regular;padding-bottom:5px;padding-top:5px;margin-left:0px;padding-left:10px;text-align:left;width:200px;">GRABADO LÁSER</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #e3070e;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        Este tipo de acabado consiste en hacer un marcado del material empleando un rayo láser que concentra la aplicación del calor.\r\n        Los materiales que pueden ser grabados con este sistema son, plásticos, metales, madera, vidrio, mármol, cuero y muchos otros materiales orgánicos.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-106px;margin-left:607px;width:250px;">\r\n        <span style="color:#e3070e;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#eb6a6e;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Metal, aluminio, vidrio, madera y plástico.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8">\r\n    <h3 style="background:#112e54;color:white;font-family:Aleo-Regular;padding-bottom:5px;padding-left:5px;padding-right:5px;padding-top:6px;text-align:center;width:190px;">PUNTA DIAMANTE</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        Este proceso se emplea por medio de un proceso automatizado, en el cual se encuentra una punta de diamante que marca\r\n        con precisión la superficie del material de acuerdo al diseño que se tiene en una computadora.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-88px;margin-left:607px;width:250px;">\r\n        <span style="color:#a6b1bd;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#5b7fb3;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Metal y alumino.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8">\r\n    <h3 style="background:#e3070e;color:white;font-family:Aleo-Regular;padding:5px;padding-left:6px;text-align:center;width:135px;">SAND BLAST</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #e3070e;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        Consiste en la aplicación de un chorro de arena a presión sobre el material que previamente fue forrado con un vinil\r\n        para permitir el paso del chorro solamente en el dibujo que se requiera grabar. En esta técnica se puede pintar la \r\n        superficie grabada.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-88px;margin-left:607px;width:250px;">\r\n        <span style="color:#e3070e;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#eb6a6e;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Metal, vidrio y cerámica.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8">\r\n    <h3 style="background:#112e54;color:white;font-family:Aleo-Regular;padding:5px;padding-left:0px;text-align:center;width:175px;">TAMPOGRAFÍA</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        En esta técnica se utiliza una placa con el logotipo grabado en bajo relieve y un tapón que es usado como un sello\r\n        para transferir la tinta al objeto que se imprime. La finalidad de este sistema es poder hacer impresiones en objetos\r\n        que tengan una forma irregular y en espacios más pequeños.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-106px;margin-left:607px;width:250px;">\r\n        <span style="color:#a6b1bd;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#5b7fb3;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Metales y plásticos.\r\n        </p>\r\n    </div>\r\n</div>\r\n<br>\r\n<div class="grid12-8" style="margin-top:15px;">\r\n    <h3 style="background:#e3070e;color:white;font-family:Aleo-Regular;padding:5px;padding-left:10px;text-align:center;width:200px;">GRABADO EN SECO</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #e3070e;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        El grabado en seco consiste en la aplicación del calor y presión en un clinché sobre un sustrato flexible para crear un bajorrelieve.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-70px;margin-left:607px;width:250px;">\r\n        <span style="color:#e3070e;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#eb6a6e;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Papel, piel, curpiel.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8">\r\n    <h3 style="background:#112e54;color:white;font-family:Aleo-Regular;padding:5px;padding-left:5px;text-align:center;width:170px;">HOT STAMPING</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        El Hot Stamping es similar al grabado en seco porque aplicar calor, pero en lugar de crear un bajorrelieve se aplica una película\r\n        metálica para generar la impresión del logotipo lo que da como resultado un acabado en color metálico.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-88px;margin-left:607px;width:250px;">\r\n        <span style="color:#a6b1bd;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#5b7fb3;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Papel, piel, curpiel.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8">\r\n    <h3 style="background:#e3070e;color:white;font-family:Aleo-Regular;padding:5px;padding-left:14px;text-align:left;width:160px;">TRANSFER</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #e3070e;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        El transfer es una película que se encuentra pegada a un papel especial, que al ser calentado se separa la parte\r\n        plástica de la película en donde está el diseño y se transfiere la imagen impresa a la superficie de la aplicación.\r\n        Es un acabado empleado en textiles.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-106px;margin-left:607px;width:250px;">\r\n        <span style="color:#e3070e;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#eb6a6e;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Textil.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8" style="margin-top:15px;">\r\n    <h3 style="background:#112e54;color:white;font-family:Aleo-Regular;padding:5px;padding-left:0px;text-align:center;width:170px;">SUBLIMACIÓN</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        La impresión por sublimación es el método por el cual se realiza una impresión en un papel especial o un objeto de \r\n        poliéster. El proceso consiste en realizar la impresión a unos 400 grados Fahrenheit sobre el transfer que colocamos\r\n        al artículo ó imagen que vamos a imprimir, el calor se aplica a una plancha térmica. El calor se encarga de volver el\r\n        proceso a sublimación; ósea lo trasforma a gas. Este proceso se encarga de abrirle poros al poliéster; paso seguido el gas\r\n        penetra el material. Terminado el proceso la impresión comienza a enfriarse y se cierran los poros y es en estepunto donde queda\r\n        lista la impresión.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-178px;margin-left:607px;width:250px;">\r\n        <span style="color:#a6b1bd;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#5b7fb3;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Metal, aluminio, vidrio, textil, cerámica.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8" style="margin-top:100px;">\r\n    <h3 style="background:#e3070e;color:white;font-family:Aleo-Regular;padding:5px;padding-left:16px;text-align:left;width:170px;">VITRIFICADO</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #e3070e;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        La decoración vitrificada es una técnica de decoración de alta calidad y durabilidad que puede realizarse en artículos\r\n        de cerámica, porcelana y vidrio. Los artículos decorados mediante serigrafía vitrificada son aptos para microondas y lavavajillas.\r\n        Para la decoración mediante éste método se serigrafía directamente sobre la pieza, con máquinas de serigrafía cilíndrica o plana,\r\n        según el artículo a decorar. Este proceso se realiza para diseños de una sola tinta y/o diseños de poca complejidad. Existe\r\n        cierta limitación de zona decorable. Una vez realizada la impresión las piezas se cuecen en hornos industriales a alta temperatura\r\n        ( 800° en porcelana y cerámica, 600° en vidrio), para que las tintas especiales vitrifiquen\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-196px;margin-left:607px;width:250px;">\r\n        <span style="color:#e3070e;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#eb6a6e;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Cerámica, porcelana y vidrio.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8" style="margin-top:115px;">\r\n    <h3 style="background:#112e54;color:white;font-family:Aleo-Regular;padding:5px;padding-left:8px;text-align:center;width:180px;">GOTA DE RESINA</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        El adhesivo con Gota de Resina se realiza primero con un gráfico impreso que se coloca en el lugar de aplicación para\r\n        después aplicar una gota de resina que le ofrece ese agradable tacto y efecto lupa. Partiendo de una hoja impresa, \r\n        troquelada a medio corte, una máquina dosifica una resina poliuretánica de altísima calidad y extraordinaria transparencia,\r\n        dotando al producto de un efecto tridimensional, con brillo y una alta protección a la decoración tanto por los efectos de\r\n        los rayos ultravioleta de la luz del sol, como por la agresión química de productos de limpieza y el roce. Cuando está seca\r\n        la Gota de Resina ya unida a una base de papel-cartón, se adhiere sobre las siguientes superficies.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-196px;margin-left:607px;width:250px;">\r\n        <span style="color:#a6b1bd;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#5b7fb3;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Metal, Aluminio, Plástico.\r\n        </p>\r\n    </div>\r\n</div>\r\n\r\n<div class="grid12-8" style="margin-top:115px;">\r\n    <h3 style="background:#e3070e;color:white;font-family:Aleo-Regular;padding:5px;padding-left:23px;text-align:left;width:135px;">BORDADO</h3>\r\n    <b class="section-title padding-right" style="border-bottom: 1px solid #e3070e;margin-top: -24px;max-width: 660px;"></b>\r\n    <br>\r\n    <p style="font-size:15px;width:570px;margin-left: 10px;">\r\n        Consiste en hacer una serie de puntadas en algún textil entrelazando hilo de distintos colores.\r\n    </p>\r\n    <div class="impresiones_mobile" style="margin-top:-70px;margin-left:607px;width:250px;">\r\n        <span style="color:#e3070e;font-size:27px;margin-left:-15px;margin-top:3px;position:absolute;">›</span>\r\n        <h3 style="background:#eb6a6e;color:white;padding-bottom:5px;text-align:center;">Aplicaciones</h3>\r\n        <br>\r\n        <p style="font-size:15px;">\r\n            Industria Textil.\r\n        </p>\r\n    </div>\r\n</div>\r\n<input id="impresiones_active" name="impresiones_active" type="hidden" value="1" />', '2014-08-11 07:36:52', '2014-11-22 07:59:33', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
