(26, 'Preguntas Frecuentes', 'one_column', NULL, NULL, 'preguntas-frecuentes', NULL, '<style type="text/css">\r\n    @font-face {\r\n        font-family: BentonSans-Book;\r\n        src: url(skin/frontend/fortis/default/css/fonts/benton/BentonSans-Book.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Regular;\r\n        src: url(skin/frontend/fortis/default/css/fonts/benton/BentonSans-Regular.otf);\r\n    }\r\n    @font-face {\r\n        font-family: BentonSans-Medium;\r\n        src: url(skin/frontend/fortis/default/css/fonts/benton/BentonSans-Medium.otf);\r\n    }\r\n    @font-face {\r\n        font-family: Aleo-Regular;\r\n        src: url(skin/frontend/fortis/default/css/fonts/aleo/Aleo-Regular.otf);\r\n    }\r\n    .accordion .opener {\r\n        background: #adc0d9;\r\n        text-align: center;\r\n    }\r\n     .flecha_politica{\r\n        border-top: 7px solid #112e52;\r\n        border-left: 7px solid transparent;\r\n        border-right: 7px solid transparent;\r\n        cursor:pointer;\r\n        height: 0;\r\n        margin-left: 5px;\r\n        margin-top: 5px;\r\n        position: absolute;\r\n        width: 0;\r\n    }\r\n    .preguntas{\r\n        font-family: ''Aleo-Regular'';\r\n        font-size: 18px;\r\n    }\r\n    .main.container.show-bg{\r\n        margin-left: -18px !important;\r\n    }\r\n\r\n    @media only screen and ( max-width: 961px ) {\r\n        .sidebar{\r\n\r\n            display: none;\r\n        }\r\n        .title_frecuentes_horarios{\r\n            margin-top: 150px !important;\r\n        }\r\n    }\r\n\r\n    @media only screen and ( max-width: 511px ) {\r\n        .buscadores_frecuentes, .buscadores_frecuentes p{\r\n            width: 294px !important;\r\n        }\r\n        .main.container.show-bg{\r\n            margin-left: 0px !important;\r\n            width: 300px !important;\r\n        }\r\n        .title_frecuentes_horarios{\r\n            margin-top: 162px !important;\r\n        }\r\n        .title_frecuentes_solicitar{\r\n            margin-top: 120px !important;\r\n        }\r\n        .title_frecuentes_mejor{\r\n            margin-top: 100px !important;\r\n        }\r\n        .std img{\r\n            display: none;\r\n        }\r\n        .h3_a{\r\n            margin-top: 70px !important;\r\n            width: 294px !important;\r\n        }\r\n        .h3_b{\r\n            margin-top: 142px !important;\r\n            width: 294px !important;\r\n        }\r\n        .h3_c{\r\n            margin-top: 161px !important;\r\n            width: 294px !important;\r\n        }\r\n        .h3_e{\r\n            margin-top: 170px !important;\r\n            width: 294px !important;\r\n        }\r\n    }\r\n</style>\r\n<div class="main container show-bg">\r\n    <div class="preface grid-full in-col1"></div>\r\n    <div class="col-main grid12-9 grid-col2-main in-col2">\r\n        <div class="std" style="border-bottom:solid 1px #83a1c7;height:230px;">\r\n            <div class="buscadores_frecuentes">\r\n                <h1 style="font-family:Aleo-Regular;font-size:31px;">Preguntas frecuentes</h1>\r\n                <p class="preguntas" style="box-shadow:0px -3px 4px #c2c2c2;width:385px;">\r\n                    ¿Qué productos puedes adquirir en Doble Vela?&#32;&#32;<a href="#adquirir"><span class="flecha_politica"></span></a>\r\n                </p>\r\n                <p class="preguntas" style="box-shadow:0px -3px 4px #c2c2c2;width:355px;">\r\n                    ¿Por qué somos tu mejor opción de compra?&#32;&#32;<a href="#mejor_opcion"><span class="flecha_politica"></span></a>\r\n                </p>\r\n                <p class="preguntas" style="box-shadow:0px -3px 4px #c2c2c2;width:355px;">\r\n                    ¿Cómo puedo solicitar precios y existencias?&#32;&#32;<a href="#solicitar"><span class="flecha_politica"></span></a>\r\n                </p>\r\n                <p class="preguntas" style="box-shadow:0px -3px 4px #c2c2c2;width:260px;">\r\n                    ¿Cuáles son las formas de pago?&#32;&#32;<a href="#formas_pago"><span class="flecha_politica"></span></a>\r\n                </p>\r\n                <p class="preguntas" style="box-shadow:0px -3px 4px #c2c2c2;width:335px;">\r\n                    Horarios de servicio y atención a clientes&#32;&#32;<a href="#horarios"><span class="flecha_politica"></span></a>\r\n                </p>\r\n            </div>\r\n            <div style="position:relative;top:-185px;left:75%;width:17%;">\r\n                <img src="{{media url="wysiwyg/preguntas_frecuentes.png"}}" alt="Preguntas Frecuentes" />\r\n            </div>\r\n        </div>\r\n        <br><br>\r\n        <h3 class="h3_a" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-left:5px;padding-bottom:5px;width:430px;">\r\n            <a name="adquirir"></a>¿Qué productos puedes adquirir en Doble Vela?\r\n        </h3>\r\n        <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n        <div class="grid-full" style="width:100%;">\r\n            <p style="font:1.2em/1.4em georgia, serif;">\r\n                <h4 style="font-family:BentonSans-Book !important;font-size:16px !important;">IMPORTADOR CONFIABLE</h4>\r\n                Importamos productos para la creación de artículos promocionales y para el hogar. Es importante destacar que \r\n                nuestros Artículos para uso Publicitario son adaptables a cualquier proceso de Diseño de impresión, como grabado\r\n                en láser, grabado en punta diamante, serigrafía, tampografía, Hot Stamping (entre otras técnicas).\r\n            </p>\r\n        </div>\r\n        <br><br>\r\n        <h3 class="h3_b" class="title_frecuentes_mejor" style="background:red;color:white;font-family:Aleo-Regular;font-size:18px;margin-top:90px;padding-left:5px;padding-bottom:5px;width:395px;">\r\n            <a name="mejor_opcion"></a>¿Por qué somos tu mejor opción de compra?\r\n        </h3>\r\n        <b class="section-title padding-right" style="border-bottom: 1px solid red;margin-top: -24px;max-width: 660px;"></b>\r\n        <div class="grid-full" style="width:100%;">\r\n            <p style="font-family:BentonSans-Book !important;font-size:16px !important;">\r\n                <h4 style="font-family:BentonSans-Book !important;font-size:16px !important;color:red;">CALIDAD Y PRECIO ACCESIBLE</h4>\r\n                En Doble Vela manejamos la mejor calidad en el mercado y los precios más accesibles ya que somos una empresa\r\n                seria y confiable, al ser importadores directos garantizamos un servicio rápido y eficaz, gracias a nuestro alto\r\n                stock de productos usted tiene la seguridad de inventarios reales y a disposición inmediata.<br>\r\n                <h4>EXCEPCIÓN EN PEDIDOS ESPECIALES.</h4>\r\n            </p>\r\n        </div> \r\n        <br><br>\r\n        <h3 class="h3_c" class="title_frecuentes_solicitar" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-left:5px;padding-bottom:5px;width:430px;margin-top:105px;">\r\n            <a name="solicitar"></a>¿Cómo puedo solicitar precios y existencias?\r\n        </h3>\r\n        <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n        <div class="grid-full" style="width:100%;">\r\n            <p style="font-family:BentonSans-Book !important;font-size:16px !important;">\r\n                <h4 style="font-family:BentonSans-Book !important;font-size:16px !important;">ANTES DE HACER TU PEDIDO</h4>\r\n                Solicitando a tu ejecutivo de ventas la información que requieras, ya sea por correo electrónico o vía fax.\r\n            </p>\r\n        </div>\r\n        <h3 class="h3_d" style="background:red;color:white;font-family:Aleo-Regular;font-size:18px;margin-top:90px;padding-left:5px;padding-bottom:5px;width:290px;">\r\n            <a name="formas_pago"></a>¿Cuáles son las formas de pago?\r\n        </h3>\r\n        <b class="section-title padding-right" style="border-bottom: 1px solid red;margin-top: -24px;max-width: 660px;"></b>\r\n        <div class="grid-full" style="width:100%;">\r\n            <h4 style="font-family:BentonSans-Book !important;font-size:16px !important;color:red;">PUEDES REALIZAR TRANSFERENCIA O DEPÓSITO BANCARIO</h4>\r\n            <table style="font-family:BentonSans-Book !important;font-size:16px !important;">\r\n                <tr style="border-bottom:1px solid red;">\r\n                    <td width="90">BANCO</td><td width="90">CUENTA</td><td>CLABE</td>\r\n                </tr>\r\n                <tr style="border-bottom:1px solid red;">\r\n                    <td>BANCOMER</td><td>141277766</td><td>012180001412777663</td>\r\n                </tr>\r\n                <tr style="border-bottom:1px solid red;">\r\n                    <td>BANAMEX</td><td>3216315153</td><td>002180032163151533</td>\r\n                </tr>\r\n            </table>\r\n            <p>\r\n                <h4 style="color:red;">TARJETA DE CRÉDITO.</h4><br>\r\n                <span style="color:red;">SI EL PAGO ES POR MEDIO DE TARJETA DE CRÉDITO O DÉBITO SE COBRA EL 3% DE COMISIÓN</span>\r\n            </p>\r\n        </div>\r\n        <br><br>\r\n        <h3  class="h3_e" class="title_frecuentes_horarios" style="background:#112e54;color:white;font-family:Aleo-Regular;font-size:18px;padding-left:5px;padding-bottom:5px;width:430px;margin-top:135px;">\r\n            <a name="horarios"></a>Horarios de servicio y atención a clientes\r\n        </h3>\r\n        <b class="section-title padding-right" style="border-bottom: 1px solid #84a1c4;margin-top: -24px;max-width: 660px;"></b>\r\n        <div class="grid-full" style="width:100%;">\r\n            <p  style="font-family:BentonSans-Book !important;font-size:16px !important;">\r\n                <h4 style="font-family:BentonSans-Book !important;font-size:16px !important;">HORARIO DE VENTAS</h4>\r\n                9:00am a 17:30pm.<br>\r\n                PARA MEJOR ATENCIÓN CONSULTE CON SU EJECUTIVO DE VENTAS EN LOS HORARIOS INDICADOS.<br><br>\r\n                CON LA FINALIDAD DE OFRECERLE UN MEJOR SERVICIO LE SUGERIMOS REALIZAR CITA PREVIA PARA SU ATENCIÓN EN NUESTRAS INSTALACIONES.\r\n            </p>\r\n        </div>          \r\n    </div>\r\n    <div class="col-left sidebar grid12-3 grid-col2-sidebar in-sidebar" style="margin-top:40px;">\r\n        <div class="block block-vertnav hide-below-768">\r\n            <div class="block-title" style="background:#122e54;color:white;font-family:Aleo-Regular;">\r\n                <strong><span style="font-family:Aleo-Regular;font-size:18px;">REVISA NUESTROS PRODUCTOS</span></strong>\r\n            </div>\r\n            <div class="block-content">\r\n                <ul class="accordion accordion-style1 vertnav vertnav-side clearer">\r\n                    <li class="nav-item level0 nav-1 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/boligrafos.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Bolígrafos</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-2 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/relojes.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Relojes</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-3 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/oficina.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Oficina</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-4 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/tecnologia.html" style="width:100%;">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Tecnología y entretenimiento</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-5 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/llaveros.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Llaveros</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-6 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/herramientas.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Herramientas</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-6 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/salud-belleza.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Salud y belleza</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-6 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/bolsas-maletas-textiles.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Bolsas, maletas y textiles</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-6 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/tazas-recipientes.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Tazas y recipientes</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-6 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/sublimacion.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Sublimación</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-6 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/hogar.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Hogar</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                    <li class="nav-item level0 nav-6 first parent">\r\n                        <a href="{{config path="web/unsecure/base_url"}}default_es/productos/oportunidades.html">\r\n                            <span style="font-family:BentonSans-Medium !important;font-size:13 !important;">Oportunidades</span>\r\n                            <span class="opener">\r\n                                <b style="margin-top:5px;margin-left:-3px;position:absolute;">></b>\r\n                            </span>\r\n                        </a>\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class="postscript grid-full in-col1"></div>\r\n</div>', '2014-08-22 07:45:57', '2014-11-22 10:23:18', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'Distribuidor', 'one_column', NULL, NULL, 'distribuidor', NULL, '<a name="Distribuidor"></a>\r\n<h1 style="font-family:Aleo-Regular;font-size:31px;">¿Quieres ser distribuidor?</h1>\r\n<br>\r\n\r\n<div  class="distribuidor_aa_mobile" style="height:120px;width:105%;">\r\n    <img src="{{media url=''nosotros/distribuidor_df.png''}}" alt="Clientes distrito federal" style="float:left;margin-top:10px;" />\r\n    <div class="distribuidor_mobile" style="background:url(''media/distribuidor/recuadro_chico.png'');color:white;font-family:BentonSans-Book;font-size:15px;height:130px;margin-top:15px;padding:10px;width:580px;margin-left:135px;">\r\n        <div class="distribuidor_texto_mobile" style="margin-top:10px;width:505px;margin-left:65px;">\r\n            Haber realizado DOS compras de monto mínimo*, en un periodo no mayor a 60 días a la fecha que requiera iniciar su trámite como Distribuidor; o bien que haya ejecutado una compra de monto mayor* en una sola exhibición.\r\n            <br>\r\n            *Comunícate al área de ventas y solicita más detalles o concerta una cita.\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<div class="distribuidor_a_mobile" style="height:120px;margin-top: 50px;width:105%;">\r\n    <img src="{{media url=''nosotros/distribuidor_foraneo.png''}}" alt="Clientes foraneos" style="float:left;margin-top:0px;" />\r\n    <div class="distribuidor_mobile" style="background:url(''media/distribuidor/recuadro_grande.png'');color:white;font-family:BentonSans-Book;font-size:15px;height:160px;margin-top:15px;padding:10px;width:580px;margin-left:135px;">\r\n        <div class="distribuidor_texto_mobile" style="margin-top:7px;width:510px;margin-left:65px;">\r\n            Haber realizado DOS compras de monto mínimo*, en un periodo no mayor a 60 días a la fecha que requiera iniciar su trámite como Distribuidor; o bien que haya ejecutado una compra de monto mayor* en una sola exhibición. Los montos para clientes foráneos son menores a los que se requieren en Distrito Federal y Área Metropolitana.\r\n            <br>\r\n            *Comunícate al área de ventas y solicita más detalles o concerta una cita.\r\n        </div> \r\n    </div>\r\n</div>\r\n\r\n<div class="distribuidor_b_mobile" style="height:120px;width:105%;margin-top:70px;">\r\n    <img src="{{media url=''nosotros/distribuidor_pubblico.png''}}" alt="Clientes publicos" style="float:left;margin-top:-10px;" />\r\n    <div class="distribuidor_mobile" style="background:url(''media/distribuidor/recuadro_chico.png'');font-family:BentonSans-Book;font-size:15px;height:130px;margin-top:15px;padding:10px;width:580px;margin-left:135px;">\r\n        <div class="distribuidor_texto_mobile" style="margin-top:15px;width:515px;color:white;margin-left:60px;">\r\n            En el caso de las “Agencias de Publicidad”, no se solicitará como requisito haber realizado compras anteriores a la fecha en la que requiera iniciar su trámite como Distribuidor; sin embargo se requerirá se realice una visita a sus instalaciones para hacer un análisis de su alta y la verificación de su giro. \r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<br><br><br>\r\n<h3 class="distribuidor_requisitos" style="background:red;color:white;font-family:Aleo-Regular;font-size:18px;padding-bottom: 5px;width:195px;">Requisitos</h3>\r\n<b class="section-title padding-right" style="border-bottom: 1px solid red;margin-top: -24px;max-width: 660px;"></b>\r\n<br>\r\n<div class="grid-full" style="margin-left:0px;width:100%;">\r\n    <span style="color:red;font-family:BentonSans-Book;font-size:16px;font-weight:bold;">SOLICITUD DE FORMATO DE ALTA DE CLIENTES</span>\r\n    <p class="requisitos_texto" style="color:#4D4D4D;font-family:BentonSans-Book;font-size:16px;">\r\n        Solicitar el formato de Alta de Clientes (se anexa el formato) que será proporcionado o enviado vía correo por personal responsable de altas de Doble Vela.\r\n    </p><br>\r\n    <span style="color:red;font-family:BentonSans-Book;font-size:16px;font-weight:bold;">ENTREGA DE DOCUMENTACIÓN (FOTOCOPIA)</span>\r\n    <p class="requisitos_texto" style="color:#4D4D4D;font-family:BentonSans-Book;font-size:16px;">\r\n        - Cédula de Identificación Fiscal (RFC)<br>\r\n        - Alta ante la S.H.C.P.<br>\r\n        - Comprobante de Domicilio Fiscal (con una vigencia no mayor a tres meses: teléfono, luz, predial, agua).<br>\r\n        - Identificación oficial por ambos lados con la foto y firma (credencial de I.F.E. o Pasaporte vigente).<br>\r\n        - Es necesario presentar las primeras tres hojas del Acta Constitutiva o lo apartados donde se define su giro*<br>\r\n        - (*Aplica sólo para el trámite de alta de Agencia de Publicidad).<br>\r\n    </p>\r\n</div>', '2014-09-04 01:36:33', '2014-11-22 08:41:44', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
